import { Navbar } from "react-bootstrap";
import { NavLink} from "react-router-dom";
import img from "../assets/img/localizacion.jpg";

export default function Navigation() {

const setActiveClass = ({ isActive }) => (isActive ? "active" : undefined);


  return (
    <>
      <Navbar className="color-menu d-flex justify-content-between align-items-center ">
        <NavLink
          to="#"
          className="text-white me-4 text-decoration-none {setActiveClass}"
        >
          <img src={img} alt="" />
        </NavLink>
        <div>
          <NavLink
            to="/"
            className="text-white ms-4 text-decoration-none {setActiveClass} "
          >
            Home
          </NavLink>
          <NavLink
            className={setActiveClass}
            to="/Pokemones"
            className=" text-white ms-4 text-decoration-none "
          >
            Pokemones
          </NavLink>
        </div>
      </Navbar>
    </>
  );
}
